Компания «Ортэн» продает и обслуживает копировально-множительную технику Ricoh, Gestetner с 1999 года. Инженеры сервисного центра регулярно проходят обучение и сертификацию по ремонту и обслуживанию данной техники.
Сервисный центр «Ортэн» оперативно и качественно оказывает услуги по ремонту копиров и МФУ Ricoh, Gestetner.
Порядок оказания услуг:
    -выезд специалиста на место, проведение профилактической чистки, диагностика и выявление причин неисправности;
    -в случае отсутствия необходимости замены деталей или расходных материалов, производится ремонт и выставляется счет на оплату;
    -в случае необходимости замены деталей или расходных материалов, утверждается окончательная стоимость ремонта и выставляется счет на оплату;
    -оплаты в срок до 5 рабочих дней производится ремонт и составляется двусторонний акт;
    -гарантия 30 календарных дней предоставляется на выполненные работы и установленные запасные части, приобретенные в нашей компании.
Для оформления заказа на ремонт или профилактическое обслуживание оргтехники звоните!
В нашем магазине вы можете приобрести расходные материалы и запчасти для копировальной техники Ricoh, Gestetner.

