Компания «Ортэн» предоставляет услуги по абонентскому обслуживанию и ремонту офисной техники, в том числе компьютеров и ноутбуков, в Николаеве. Услуги предоставляются при обязательном заключении договора. R2D2 - наш доблестный защитник братьев своих меньших с особой заботой настраивает и чинит друзей!
Наши специалисты под предводительством одноглазого астромеханического дроида лихо сражаются с поломками и сбоями, обслуживают компьютерное, печатное и сетевое оборудование. Мы предлагаем:
выезды по вашему адресу для ремонта; 
выезды по вашему адресу для планового осмотра техники; 
прием техники для ремонта в нашем офисе;
консультации; 
налаживание системы резервирования данных;
дистанционное администрирование;
настройку сетевой безопасности;
обслуживание и ремонт копировальной техники фирм Ricoh, Gestetner, Develop, Konica-Minolta, а также других производителей;
обслуживание и ремонт МФУ и принтеров;
обслуживание и ремонт копиров (копировально-множительной техники);
обслуживание и ремонт компьютеров и ноутбуков;
установку операционных систем Windows и Linux (Линукс) и программного обеспечения;
реставрацию и заправку картриджей (МФУ и лазерных принтеров).
Каждая из услуг представленного перечня обговаривается в индивидуальном порядке и прописывается в договоре таким образом, чтобы максимально удовлетворить потребности клиента.

Сервисный центр компании «Ортэн» выполняет:
ремонт принтеров и МФУ HP;
ремонт принтеров и МФУ Canon;
ремонт принтеров и МФУ Samsung;
ремонт принтеров и МФУ Xerox;
ремонт принтеров и МФУ Brother;
заправку картриджей лазерного принтера (ч/б и цветных);
восстановление картриджей лазерных принтеров (замену фотобарабана).
Заправка картриджей и ремонт лазерной техники формата А4 осуществляется в сервисном центре компании.
Звоните, приходите, мы поможем!
Кому мы не сможем помочь: мы не занимаемся обслуживанием струйных принтеров и заправкой картриджей для них.

